pragma solidity ^0.8.9;

contract Book{

    struct Percent{
        uint256 percent;
        address addr;
    }

    mapping (uint256 => uint256) public sumPercent;

    mapping (uint256 => Percent[]) public percents;

    function setPercents(uint256 _index, Percent[] memory _percents) public {
        delete percents[_index]; 
        for (uint256 i =0; i<_percents.length; i++){
            percents[_index].push(_percents[i]);
        }
    }
}

