    function countGas(uint256 _range) external view returns(uint256, uint256){
        // uint256  amount = gasleft();
        // return amount;
        uint256 startGas = gasleft();

        for (uint i = 0; i<_range; i++){}

        uint256 gasUsed = startGas - gasleft();
        return (gasUsed, startGas);
    }
}

